import './App.css';
import { Routes, Route } from 'react-router-dom'
import { About } from './components/About'
import { Users } from './components/Users'

function App() {
  return (

        <Routes>
          <Route path='/about' element={<About />} />
          <Route path='/' element={<Users />} />
        </Routes>

  )
}

export default App;
